import * as React from 'react';
import { useState } from 'react';
import { AppBar, Box, Button, Container, IconButton, Toolbar, Typography, Paper } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles({
  mainFeaturesPost: {
    position: "relative",
    color: "#fff",
    marginBottom: "4rem",
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center",
    height: "60vh",
  },
});

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const classes = useStyles();

  const handleLogIn = () => {
    setIsLoggedIn(true);
  };

  const handleLogOut = () => {
    setIsLoggedIn(false);
  };

  return (
    <div>
      <AppBar position="fixed">
        <Container fixed>
          <Toolbar>
            <IconButton edge="start" color="inherit" aria-label="menu">
              <MenuIcon />
            </IconButton>
            <Typography variant="h6">Nomad's Odyssey</Typography>
            <Box sx={{ flexGrow: 1 }} />
            {isLoggedIn ? (
              <Button color="inherit" variant="outlined" onClick={handleLogOut}>
                Log Out
              </Button>
            ) : (
              <>
                <Button color="inherit" variant="outlined" sx={{ mr: 3 }} onClick={handleLogIn}>
                  Log In
                </Button>
                <Button color="secondary" variant="contained">
                  Sign Up
                </Button>
              </>
            )}
          </Toolbar>
        </Container>
      </AppBar>
      <Paper className={classes.mainFeaturesPost} style={{ backgroundImage: `url(https://source.unsplash.com/random )` }}>
        <Container fixed>
          <Typography component="h1" variant="h3" color="inherit" gutterBottom>
            Nomad's Odyssey
          </Typography>
          <Typography variant="h5" color="inherit" paragraph>
            Explore the beauty of Kazakhstan with our travel guides and tips.
          </Typography>
        </Container>
      </Paper>
    </div>
  );
}

export default App;
